import React from 'react';
import { NavLink } from 'react-router-dom';

export const Nav = () => {
    return (
        <nav>
            <ul>
                <li><NavLink to='/' activeClassName='active-link'>Home</NavLink></li>
                <li><a href='https://www.hardlyart.com/artists/chastity_belt'   target='_blank'>About</a></li>
                <li><NavLink to='/shows' activeClassName='active-link'>Shows</NavLink></li>
                <li><NavLink to='/music' activeClassName='active-link'>Music</NavLink></li>
                <li><NavLink to='http://chastitybelt.limitedrun.com/store' target='_blank'>Shop</NavLink></li>
                <li><NavLink to='/fan-art' activeClassName='active-link'>Fan Art</NavLink></li>
                <li><NavLink to='/contact' activeClassName='active-link'>Contact</NavLink></li>
            </ul>
        </nav>
    );
};
